	add("affair", "{\"term\":\"affair\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\"], \"text\":\"From Middle english (1100-1500) \u0027afere\u0027 \u0027affere\u0027 from Old french (842-ca. 1400) \u0027afaire\u0027 from \u0027a-\u0027 + \u0027faire\u0027 (to do) Latin \u0027ad- + facere\u0027 to do. See fact, and confer ado.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"That which is done or is to be done; matter; concern; business of any kind, commercial, professional, or public; \u0026amp;mdash; often in the plural\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any proceeding or action which it is wished to refer to or characterize vaguely\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An action or engagement not of sufficient magnitude to be called a battle\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A material object (vaguely designated\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The house was a big elaborate limestone \u0027\u0027affair\u0027\u0027, evidently new. Winter sunshine sparkled on lace-hung casement, on glass marquise, and the burnished bronze foliations of grille and door\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[https://openlibrary.org/works/OL10563347W The Three Corpse section\u003dchapter passage\u003dThe dinghy was trailing astern at the end of its painter, and Merrion looked at it as he passed. He saw that it was a battered-looking \u0027\u0027affair\u0027\u0027 of the prahm type, with a blunt snout, and like the parent ship, had recently been painted a vivid green\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An adulterous relationship (from \u0027affaire de cœur\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A party or social gathering, especially of a formal nature\", \"priority\":8}]}, \"synonyms\":{}}");

