	add("affection", "{\"term\":\"affection\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"{{borrowing|fr|affection|lang\u003den}}, from Latin {{m|la|affectiōnem}}, from {{m|la|affectiō}}; see \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of affecting or acting upon\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The state of being affected\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An attribute; a quality or property; a condition; a bodily state; as, figure, weight, etc., are affections of bodies\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Bent of mind; a feeling or natural impulse or natural impulse acting upon and swaying the mind; any emotion; as, the benevolent affections, esteem, gratitude, etc.; the malevolent affections, hatred, envy, etc.; inclination; disposition; propensity; tendency\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"issue\u003d11|page\u003d26|magazine\u003d|title\u003d[http://www.theguardian.com/books/2013/jul/27/wings-desire-mark-cocker-birds Wings of passage\u003dOur \u0027\u0027affections\u0027\u0027 for wild animals are distributed very unevenly. Take insects. Some 750,000 species have already been documented worldwide and the great American naturalist EO Wilson called them \u0026quot;the little things that run the world\u0026quot;. Through their recycling of nutrients and the supply of base-level protein to a vast array of higher life forms, insects underpin the existence of life on this planet. Yet when it comes to human concern for creepy-crawlies, forget it\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A feeling of love or strong attachment\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1813\u0027\u0027, Jane Austen, \u0027Pride and Prejudice\u0027 Chapter 6\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Mr. Bennet missed his second daughter exceedingly; his \u0027\u0027affection\u0027\u0027 for her drew him oftener from home than anything else could do. He delighted in going to Pemberley, especially when he was least expected\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Disease; morbid symptom; malady\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Dungliso\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"a pulmonary \u0027\u0027affection\", \"priority\":11}]}, \"synonyms\":{}}");

