	add("afference", "{\"term\":\"afference\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}{{rfp|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The brain’s reception of signals from the body\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1984\u0027\u0027, “The Disembodied Lady”, chapter 3 in \u0027\u0027 (Reset 2007), page 53\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Christina had lost this normal inflow, this \u0027\u0027afference\u0027\u0027, had lost her normal proprioceptive vocal tone and posture, and therefore had to use her ears, auditory feedback, instead\", \"priority\":3}]}, \"synonyms\":{}}");

