	add("affiant", "{\"term\":\"affiant\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From the present participle of Old french (842-ca. 1400) \u0027afier\u0027 from \u0027affidare\u0027 Related to \u0027affidavit\u0027 {{rfp|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The individual witness whose statement is contained in an affidavit or sworn deposition\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Further \u0027\u0027affiant\u0027\u0027 sayeth naught.\u0027 (A centuries-old statement that is still used on some legal documents as the final declaration prior to the affiant\u0027s signature\", \"priority\":2}]}, \"synonyms\":{}}");

	add("affiliate", "{\"term\":\"affiliate\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\"], \"text\":\"From \u0027\u0027 (lang\u003dla) ad + \u0027filius\u0027 (lang\u003dla) compare French \u0027affilier\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone or something, especially, a television station, that is associated with a larger, related organization, as a television network; a member of a group of associated things\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Our local TV channel is an \u0027\u0027affiliate\u0027\u0027 of NBC\", \"priority\":2}]}, \"synonyms\":{}}");

