	add("afflatus", "{\"term\":\"afflatus\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027afflatus\u0027 originally \u0027adflatu\u0027 (compare English \u0027flatulence\u0027 (digestive gas, fart) , past participle of \u0027afflo\u0027 (lang\u003dla) In artistic sense, introduced by Cicero in \u0027{{w|De Natura Deorum}}\u0027 (The Nature of the Gods) (44 BCE) II.167, as alternative to existing and similar \u0027\u0027 (literally “sucking in air”), which already had a more general and metaphorical sense, to emphasize specifically the initial insight and restore literal overtones.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sudden rush of creative impulse or inspiration, often attributed to divine influence\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"44 BCE\u0027\u0027, Marcus Tullius Cicero, \u0027,\u0027 II.16\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Nemo igitur vir magnus sine aliquo \u0027\u0027adflatu\u0027\u0027 divino umquam fuit\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"No man was ever great without a touch of divine \u0027\u0027afflatus\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Translation and quoted in 1949: , \u0027The Divine \u0027\u0027Afflatus\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Spenc\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A poet writing against his genius will be like a prophet without his \u0027\u0027afflatus\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1886\u0027\u0027, w:Henry Henry James, \u0027The Bostonians\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"She could study up as she went along; she had got the great thing that you couldn\u0027t learn, a kind of divine \u0027\u0027afflatus\u0027\u0027, as the ancients used to say, and she had better just begin on that\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A breath or blast of wind\", \"priority\":10}]}, \"synonyms\":{}}");

