	add("affliction", "{\"term\":\"affliction\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027afliction\u0027 from Latin \u0027afflictio\u0027 from \u0027affligere\u0027 See afflict.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A state of pain, suffering, distress or agony\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Something which causes pain, suffering, distress or agony\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1913\u0027\u0027, w:Willa Willa Cather, \u0027s:O O Pioneers\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"She wore a man\u0027s long ulster (not as if it were an \u0027\u0027affliction\u0027\u0027, but as if it were very comfortable and belonged to her; carried it like a young soldier\", \"priority\":4}]}, \"synonyms\":{}}");

	add("affluence", "{\"term\":\"affluence\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027affluence\u0027 from Latin \u0027affluentia\u0027 nly relation to antonym \u0027\u0027 is common Latinate suffix; \u0027\u0027affluence\u0027\u0027 only acquired sense of wealth in 16th century English and French, while \u0027indigent\u0027 meant “poor” in Latin.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An abundant flow or supply\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An abundance of wealth\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"His \u0027\u0027affluence\u0027\u0027 was surpassed by no man\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A moderate level of wealth\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The had achieved \u0027\u0027affluence\u0027\u0027, but aspired to true wealth\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"An influx\", \"priority\":6}]}, \"synonyms\":{}}");

	add("affluent", "{\"term\":\"affluent\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"Middle french (ca. 1400-1600) \u0027affluent\u0027 from Latin \u0027affluentem\u0027 accusative singular of {{m|la|affluēns}}, present active participle of {{m|la|affluō||flow to or towards; overflow with}}, from \u0027ad\u0027 (to, towards) + {{m|la|fluō||flow}} (cognate via latter to \u0027\u0027 \u0027\u0027 . Sense of “wealthy” (plentiful flow of goods) c. 1600, which also lead to nominalization \u0027\u0027 \u0026lt;ref\u0026gt;{{R:Online Etymology Dictionary}}\u0026lt;/ref\u0026gt;Only relation to antonym \u0027\u0027 is common Latinate suffix {{suffix||ent|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Somebody who is wealthy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, Philip D. Cooper, \u0027Health care marketing: a foundation for managed quality\u0027 (page 183\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027affluents\u0027\u0027 are most similar to the professional want-it-alls in their reasons for preferring specific hospitals and in their demographic characteristics\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A stream or river flowing into a larger river or into a lake; a tributary stream; a tributary\", \"priority\":4}]}, \"synonyms\":{}}");

	add("affluenza", "{\"term\":\"affluenza\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|affluence|influenza|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A feeling of dissatisfaction, anxiety, etc, caused by the dogged and ongoing pursuit of more.\u0026lt;!--Original defs, which all amount to the same thin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a painful, contagious, socially transmitted condition of overload, debt, anxiety and waste resulting from the dogged pursuit of mor\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1. The bloated, sluggish and unfulfilled feeling that results from efforts to keep up with the Joneses. 2. An epidemic of stress, overwork, waste and indebtedness caused by dogged pursuit of the American Dream. 3. An unsustainable addiction to economic growth.--\u0026gt\", \"priority\":3}]}, \"synonyms\":{}}");

	add("affordability", "{\"term\":\"affordability\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\u0027afford\u0027 + \u0027-ability\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The extent to which something is affordable, as measured by its cost relative to the amount that the purchaser is able to pay\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"First-time home buyers are feeling the squeeze of higher interest rates with mortgage \u0027\u0027affordability\u0027\u0027 at its worst level for 16 years\", \"priority\":2}]}, \"synonyms\":{}}");

