	add("affray", "{\"term\":\"affray\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"German\", \"English\", \"middle english (1100-1500)\", \"frankish\", \"old french (842-ca. 1400)\", \"old high german (ca. 750-1050)\", \"anglo-norman\"], \"text\":\"From Middle english (1100-1500) \u0027afraien\u0027 (to terrify, frighten) from Anglo-norman \u0027afrayer\u0027 (to terrify, disquiet, disturb) from Old french (842-ca. 1400) \u0027effreer\u0027 \u0027esfreer\u0027 (to disturb, remove the peace from) from \u0027\u0027 (es-) + \u0027\u0027 (freer) from Frankish *\u0027\u0027 (friþu) from Proto-germanic {{m|gem-pro|*friþuz||peace}}, from Proto-germanic {{m|gem-pro|*frijōną||to free; to love}}, from Proto-indo-european {{m|ine-pro|*prāy-}}, {{m|ine-pro|*prēy-||to like, love}}. Cognate with Old high german (ca. 750-1050) \u0027fridu\u0027 (peace) Old english (ca. 450-1100) \u0027friþ\u0027 (peace, frith) Old english (ca. 450-1100) {{m|ang|frēod||peace, friendship}}, German \u0027friede\u0027 (peace) Compare also {{l|en|afear}}. More at {{l|en|free}}, {{l|en|friend}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of suddenly disturbing any one; an assault or attack\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A tumultuous assault or quarrel\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The fighting of two or more persons, in a public place, to the terror of others\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027affray\u0027\u0027 in the busy marketplace caused great terror and disorder\", \"priority\":4}]}, \"synonyms\":{}}");

	add("affricate", "{\"term\":\"affricate\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin {{m|la|affricatus}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sound produced using a combination of a plosive and a fricative. English sounds /t͡ʃ/ (ca\u0027tch\u0027) and /d͡ʒ/ (\u0027j\u0027ury) are examples\", \"priority\":1}]}, \"synonyms\":{}}");

